    "analysis": "Graff suggested it's time for the team to \"let Cousins cook\" in an offense that should be more pass heavy without Dalvin Cook, its unquestioned offensive centerpiece. Head coach Mike Zimmer has long advocated for a balanced offense, and that's reflected in Vikings' rank of 23rd in pass frequency in neutral situations this year. \"That\u2019s right where Zimmer wants to be, an offense that throws half the time and runs half the time,\" Graff said. With one of the NFL's best receiver tandems and a serviceable No. 3 receiver in K.J. Osborn, Minnesota is certainly well positioned to thrive with a pass-heavy attack down the stretch. Through Week 12, they have one of the league's best passing offenses, ranking sixth in expected points added (EPA) per pass attempt. They have the third best EPA per drop back over the past five weeks. A ramped-up Minnesota passing attack would unlock a weekly fantasy ceiling for all involved. Alexander Mattison, based on rushing and pass catching volume alone, will be a top-12 fantasy option with Cook sidelined.\u00a0\n",
