    "analysis": "Wentz completed 16-of-24 passes for 197 yards and all three of his touchdowns in the first half, building a 24-14 lead over the Bucs with a 62-yard drop into a bucket to Ashton Dulin, 15-yard strike on a wheel route to Jack Doyle, and a four-yard throw on 4th-and-1 while rolling out to his right to T.Y. Hilton. The tide turned in the third quarter for the Bucs as Shaq Barrett blindsided Wentz for a sack-fumble on Indianapolis' first drive out of the half, tracked Wentz's shot downfield to Michael Pittman for an interception during the ensuing possession, and capitalized later on a muffed punt from Nyheim Hines, turning those three turnovers into 17 points. Leonard Fournette scrambled in for a 28-yard score, his fourth of the day, to end the Colts' dreams of taking down the Super Bowl champs with only :20 remaining in regulation. 6-6 and still a full two games behind the 8-4 Titans for the AFC South lead, Indianapolis' upcoming rebound against the Texans is a crucial one in the AFC Wild Card picture.\u00a0\n",
