    "report": "",
    "analysis": "Lance, the third pick in the 2021 NFL Draft, has one touch since Week 6 -- a three-yard rush against the Jaguars in Week 11. Shanahan said Lance's lack of playing time has nothing to do with his practice performance or preparation -- the team has a Lance-based package for every game -- but rather Shanahan's comfort as the team's offensive play caller.\u00a0\u201cWhat\u2019s been hard on me ... is when you do bring in a different quarterback who gets a different set of plays, it\u2019s almost the first play I\u2019ve been seeing of a new defense,\" Shanahan said, adding a QB rotation \"kind of hurts my rhythm a little bit.\" The 49ers offense has been humming of late, giving Shanahan little reason to force Lance into the lineup. Whether the team can avoid a quarterback rotation with Deebo Samuel (groin) sidelined remains to be seen. Lance should only be rostered as a stash in superflex leagues.\u00a0\n",
