    "analysis": "Seventy-nine of Jefferson's 93 yards came on a deep shot from Matthew Stafford in the first half. Jefferson hauled in the rainbow ball and broke away from a Packers defender for the walk-in score. Jefferson left a lot of production on the field though: He stepped out of bounds on a would-be touchdown pass from Cooper Kupp in the first half and he dropped an easy 15-yard pass in the fourth quarter that would have put him over 100 yards on the day. Running as a starter with Robert Woods (ACL) done for the season, Jefferson should be a weekly high-end WR3, at worst. The underperforming LA defense creating ample negative game script has been excellent for Jefferson and the team's other pass catchers. He consistently enjoyed single coverage against the Packers while Green Bay's secondary focused on stopping Cooper Kupp. Jefferson, like every fantasy relevant Ram, will be an intriguing option next week against Jacksonville.\u00a0\n",
